import React, { useState, useEffect } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import "./Dashboard.css";

function Dashboard() {
  const [history, setHistory] = useState([]);
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();
  const userId = localStorage.getItem("userId");

  const fetchHistory = async () => {
    setLoading(true);
    try {
      const response = await axios.get(`http://localhost:5000/api/history/${userId}`);
      setHistory(response.data);
    } catch (error) {
      console.error("Error fetching history:", error);
    }
    setLoading(false);
  };

  useEffect(() => {
    if (!userId) {
      navigate("/dashboard");
    } else {
      fetchHistory();
    }
  }, [userId, navigate]);

  return (
    <div className="dashboard-container">
      <h2>Diagnosis History</h2>
      {loading && <p>Loading...</p>}
      <div className="history-container">
        {history.map((item, index) => (
          <div key={index} className="history-item">
            <img src={`http://localhost:5000/${item.imagePath}`} alt="Uploaded" />
            <div>
              <h3>Diagnosis:</h3>
              <ul>
                {item.diagnosis.map((d, i) => (
                  <li key={i}>{d.label} - {(d.score * 100).toFixed(2)}%</li>
                ))}
              </ul>
              <p><strong>Date:</strong> {new Date(item.timestamp).toLocaleString()}</p>
            </div>
          </div>
        ))}
      </div>
      <button onClick={() => navigate("/ImageUpload")} className="upload-button">
        Upload Image
      </button>
    </div>
  );
}

export default Dashboard;
